import React, { createContext, useState } from "react";

export const SkillsContext = createContext({
  skills: []
});

export const SkillProvider = ({ children }:{children:React.ReactNode})=>{
  const [skills,setSkills] = useState([{ key: 0, label: "Angular" },
    { key: 1, label: "jQuery" },
    { key: 2, label: "Polymer" },
    { key: 3, label: "React" },
    { key: 4, label: "Vue.js" }]);
  return <SkillsContext.Provider value={[skills,setSkills]}>{children}</SkillsContext.Provider>;
};
